import React, { Fragment } from "react";

import Header from "../headerComponents/header";
import Navigation from "../navComponents/Navigation";
import Container from "../mainContainer/Container";

const Form = () => {
  return (
    <Fragment>
      <Header />
      <Navigation />
      <Container mode="form" />;
    </Fragment>
  );
};

export default Form;
